import React, {useState} from "react";
import "../Styles/ProfileInfo.css";


export default function Info({ dispatch, profile, posts}){
  const [onEdit, SetOnEdit] = useState(false)

  return(
    <div className="profileinfo">
      {
        profile.length > 0 && profile.map((info) =>(
          <div className="profileinfo-container">
            <div className="profileinfo-top">
              <img src="https://i.pinimg.com/564x/85/e5/e5/85e5e5ed3ad87c8191d5ce7ebf03399c.jpg" alt=""/>
            </div>
            <div className="profileinfo-center">
              <img src="https://i.pinimg.com/564x/c5/b5/50/c5b5501c6e48b0bd6b1a1c20de393d4c.jpg" alt=""/>
              <button className="profileinfo-centerbutton">
                EDIT PROFILE
              </button>
            </div>
            <div className="profileinfo-bottom">

            </div>
          </div>
        ))
      }
    </div>
  )
}
